import React from 'react';
import { Image } from 'antd';
function LandingBodyPage(){
    return (
        <section>
            <div>
                <Image src="https://clintwoodapartments.com/wp-content/uploads/home-image.jpg"/>    
                <p>Just 5 minutes to Twelve Corners, Park Ave, the UR Medical Center and the Canal Path</p>
            </div>
        </section>
    )
}

export default LandingBodyPage;
